import './Calendar.css';

const Calendar = () => {
  return (
    <div className="calendar">
      <h1>Calendar</h1>
      <div className="calendar-content">
        <p>Calendar interface coming soon...</p>
      </div>
    </div>
  );
};

export default Calendar;
